import React from 'react';
import logo from '../trainersPictures/logo.png';
import './Home.css'

const Home = () => {
    return (
     <>
     <div className="logo">
     <img src={logo} className="logoH"/>
     <h2>Dit</h2>
     </div>
    
    </> );
}
 
export default Home;
